import React, { Component } from 'react';
import './bootstrap/dist/css/bootstrap.min.css';
import logo from './Assets/img/logo.png';
import pic from './Assets/img/pic.png';


class HeaderComponent extends Component {
    constructor(props) {
        super(props);

        this.state = {};
    }

    render() {
        return (
            <div>
                <div>
                    <nav className="navbar navbar-expand-lg bg-body-tertiary" style={{ backgroundColor:'#000000' }}>
                        <div className="container-fluid">
                            <a className="navbar-brand" href="/inventories">
                                <img
                                    src={logo}
                                    alt="Logo"
                                    width="30"
                                    height="24"
                                    className="d-inline-block align-text-top"
                                />
                                Inventory App
                            </a>
                            <div className='col-md-9'>
                            <div className="collapse navbar-collapse" id="navbarSupportedContent"style={{ float: 'right' }}>
                                <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                                    <li className="nav-item">
                                        <a className="nav-link active" aria-current="page" href="/inventories">
                                            Home
                                        </a>
                                    </li>
                                    <li className="nav-item">
                                        <a className="nav-link" href="#">
                                            Link
                                        </a>
                                    </li>

                                    <li className="nav-item">
                                    <a className="navbar-brand" href="/inventories">
                                    <img
                                        src={pic}
                                        alt="Logo"
                                        style={{ width:60, height:60, borderRadius:30 }}
                                    />
                                    </a>
                                    </li>
                                </ul>
                            </div>
                            </div>
                        </div>
                    </nav>
                </div>
            </div>
        );
    }
}

export default HeaderComponent;
